import React from 'react';
import './dashboard.css'; // Assuming you have a CSS file for styles
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit } from '@fortawesome/free-solid-svg-icons'; // Import the edit icon

const DashBoard = (props) => {
    const { email } = props;

    return (
        <div className='dashboard_container'>
            <h1 className='dashboard-heading'>Account</h1>
            <br />
            <h2>
                Create a Project <span className="plus-icon">+</span> 
            </h2>
            <div className="dashboard">
                <div className="subcomponent-box">
                    <div className='first-container'>
                        <h1 className='project-name'>{email}</h1>
                        <FontAwesomeIcon icon={faEdit} className='project-edit' />
                    </div>
                    <h1 className='project-domain'>Domain: Retail</h1>
                    <h1 className='project-domain'>Package: 1</h1>
                    <div className='first-container'>
                        <h1 className='project-name'>BAP</h1>
                        <h1 className='project-name'>User Application</h1>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default DashBoard;
